package operatorsinjava;

public class OperatorsFunc {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		int b = 20;
		int c = 30;
		System.out.println("Logical Operator");
		if((a > b) && (c > a))
		{
			
			System.out.println("C is Greater");
		}
		if((a > b) || (c > a))
		{
			System.out.println("C is Greater");
		}
	
		
		
	}

	
	
}
